import styled from 'styled-components';
import { black, white } from './colours';
import { Link } from 'react-router-dom';

const Nav = styled.nav`
  postiton: fixed;
  top: 0;
`;

const HomeLink = styled(Link)`
  font-family: 'Canela';
  font-size: 1.375rem;
  color: ${black};
  text-decoraction: none;
`;

const HomeLinkHome = styled(Link)`
  position: absolute;
  height: 45px;
  left: 166px;
  right: 1037px;
  top: 41px;

  font-family: Canela;
  font-style: normal;
  font-weight: normal;
  font-size: 45px;
  line-height: 45px;

  display: flex;
  align-items: center;
  text-align: center;
`;

const ListItemHome = styled(Link)`
  font-size: 1.375rem;
  color: ${white};
  text-decoraction: none;
`;

const ListItem = styled(Link)`
  font-size: 1.375rem;
  color: ${black};
  text-decoraction: none;
`;

export { Nav, HomeLink, HomeLinkHome, ListItem, ListItemHome };
